(()=>{const t=document.getElementById("container");function n(n){const e=document.createElement("article"),r=document.createElement("div");r.classList.add("divMovie"),r.innerHTML=`\n    <img src="${n.poster}" alt="${n.title}">\n    <h3>${n.title} (${n.year})</h3>\n    <p><strong>${n.director}</strong></p> \n    <p><strong>${n.duration}</strong></p> \n    <p><strong>${n.genre.join(", ")}</strong></p> \n    <p><strong>${n.rate}</strong></p> \n    `,t.appendChild(e),e.appendChild(r)}$.get("https://students-api.up.railway.app/movies",(t=>{t.map(n)}))})();